import Message from '../layout/Message'
import {useLocation} from 'react'

function Project() {
    const location=useLocation()
    let message=''
    if(location.state){
        message=location.state.message
    }
    return(
        
        <div>
            <h1>Meus projetos</h1>
           {message&& <Message type="sucess" msg={message}/>}
         </div>   
        
    )
    }


export default Project
